response.interests:
С 2013г. развиваю бухгалтерскую компанию, в которую обратились более 300 компаний по различным вопросам от регистрации бизнеса и ИП, до восстановления учета и сдачи отчетности.

14 компаниям провели восстановление учета, из хаоса привели в порядок и снизили риски доначисления налогов и штрафов.

Самым большим проектом было – подготовка бизнеса к продаже. Был восстановлен учет за 3 предыдущих года, а также восстановлена большая часть документов.

Самым необычным проектом было консультирование и проведение семинаров в Сбербанке.

Я прошла путь от наемного бухгалтера, который не способен обозначить свою цену, брать деньги, с неуверенностью в себе и с постоянным усталостью и апатией, до руководителя своей фирмы, в которой работает 6 сотрудников, отлажены процессы оказания услуг и которому я уделяю 3 часа в день.

Я прошла свой путь от девушки, которая останется скорее всего одна, не было времени и энергии на выстраивание личных отношений, до счастливой семьи, материнства и сохранения баланса. Сейчас есть путешествия и занятия которые приносят удовольствие и время на себя.

Все это помогло мне достичь:

- разбор со своими страхами, - повышение своих компетенций, - работа над отношениями с деньгами, - понимание своих истинных целей, - работа над балансом и энергией.

В этом блоге я подробно делюсь своими наработками, пишу для бухгалтеров, которые хотят:

- быть всегда на волне изменений;

- владеть актуальной информацией;

- бухгалтера которые хотят реализовать себя по максимуму и быстрее пройти путь от наемного бухгалтера-самозанятого до руководителя своей компании;

- быть эффективными и гордиться тем, что делают, в найме, фрилансе или бизнесе;

- зарабатывать достаточно и чувствовать благополучие;

- быть в контакте со своими истинными желаниями;

- сохранить истинную природу и баланс в жизни, и реализоваться не только в карьере, но и семье.
